import axios from "axios";

export function getProducts(identifier, setProducts) {
  axios
    .post("/products", identifier)
    .then((res) => setProducts(res.data))
    .catch((err) => console.log(err));
}

export function getProduct(identifier, setProduct) {
  axios
    .post("/product", identifier)
    .then((res) => setProduct(res.data[0]))
    .catch((err) => console.log(err));
}

export function postCart(identifier) {
  axios.post("/cart/create", identifier).catch((err) => console.log(err));
}

export function postUser(identifier) {
  axios.post("/user/create", identifier).catch((err) => console.log(err));
}

export function postShipping(identifier) {
  axios.post("/shipping/create", identifier).catch((err) => console.log(err));
}

export function postPayment(identifier) {
  axios.post("/payment/create", identifier).catch((err) => console.log(err));
}
